package main

import (
	"fmt"
)

func maxSum(nums []int, m int, k int) int64 {
	res := 0
	sum := 0

	elementCount := make(map[int]int)

	for i, v := range nums {
		sum += v
		elementCount[v]++
		if i < k-1 {
			continue
		}
		if len(elementCount) >= m {
			res = max(sum, res)
		}
		removeElement := nums[i-k+1]
		elementCount[removeElement]--
		if elementCount[removeElement] == 0 {
			delete(elementCount, removeElement)
		}
		sum -= removeElement
	}

	return int64(res)
}

